--  Create Database Lock Table
CREATE TABLE edelphi.DATABASECHANGELOGLOCK (ID INT NOT NULL, LOCKED BIT(1) NOT NULL, LOCKGRANTED datetime NULL, LOCKEDBY VARCHAR(255) NULL, CONSTRAINT PK_DATABASECHANGELOGLOCK PRIMARY KEY (ID));

--  Initialize Database Lock Table
DELETE FROM edelphi.DATABASECHANGELOGLOCK;


--  Lock Database
UPDATE edelphi.DATABASECHANGELOGLOCK SET LOCKED = 1, LOCKEDBY = '0.0.0.0 (0.0.0.0)', LOCKGRANTED = '2016-11-24 09:09:48.745' WHERE ID = 1 AND LOCKED = 0;

--  Create Database Change Log Table
CREATE TABLE edelphi.DATABASECHANGELOG (ID VARCHAR(255) NOT NULL, AUTHOR VARCHAR(255) NOT NULL, FILENAME VARCHAR(255) NOT NULL, DATEEXECUTED datetime NOT NULL, ORDEREXECUTED INT NOT NULL, EXECTYPE VARCHAR(10) NOT NULL, MD5SUM VARCHAR(35) NULL, DESCRIPTION VARCHAR(255) NULL, COMMENTS VARCHAR(255) NULL, TAG VARCHAR(255) NULL, LIQUIBASE VARCHAR(20) NULL, CONTEXTS VARCHAR(255) NULL, LABELS VARCHAR(255) NULL, DEPLOYMENT_ID VARCHAR(10) NULL);

















































































































































































































































































































































































































































































--  Release Database Lock
UPDATE edelphi.DATABASECHANGELOGLOCK SET LOCKED = 0, LOCKEDBY = NULL, LOCKGRANTED = NULL WHERE ID = 1;

